import React from 'react';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { Navbar } from './Component/Navbar.js';
import { Home } from './Home.js';
import { GlobalContext, GlobalProvider } from './Global/GlobalState.js';

function App() {
  return (
    <Router>
      <GlobalContext>
        <Navbar />

        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
        </Switch>
      </GlobalContext>

    </Router>
  );
}

export default App;
